# Review: Why we model

Modeling is at the heart of data science. At best it helps us to learn about the world. At worst it leads us to shame and ruin.

### Reveal hidden structure in the data
One step beyond exploratory summaries and graphs.


- Grouping: Which observations are related to which others?
- Covariation: Which variables are related to which others?

### Predict new outcomes based on past data

- Point estimate: If I know information `\(X\)` today, what is my prediction for outcome `\(Y\)`?
- Risk: What are the best and worst-case scenarios if my prediction about `\(Y\)` is wrong?

# Today: K-means clustering

We will have a dataset `\(X\)`, **a matrix `\(n\)` rows and `\(p\)` columns.**  Each row will be written `\(X_i\)`. This is the set of `\(p\)` variable values for observation `\(i\)`.
### Key idea
For now, we **assume the variables are all numeric type.**
- `\(X_i\)` represents the `\(i\)`th observation's position in `\(p\)`-dimensional space
- observations are **similar if they are close**  together in this space

### Goal
Are there groups of of observations that are similar to each other, based on the variables we have?

### Questions for you
- Prediction or exploration?
- Supervised or unsupervised?
- Regression or classification?

---
# K-means program

`\(X_i\)`, `\(i = 1 \ldots n\)` data vectors of length `\(p\)` each, for example `\(X_{11}, X_{1,2} \ldots X_{1p}\)` are the `\(p\)` variable values for the first observation. 

Split data into `\(K\)` groups `\(C_1 \ldots C_K\)` such that we **minimize within-clustering variation**, meaning

`$$\text{argmin}_{C_1 \ldots C_K} \sum_{k = 1}^K \frac{1}{|C_k|}\sum_{i, u \in C_k} \sum_{j = 1}^p(X_{ij} - X_{uj})^2$$`

## Output
Optimization above assigns each observation `\(i\)` to a single cluster `\(C_k\)`. In other words, the `\(i\)`th observation belongs to group `\(k\)`, for some `\(k = 1 \ldots K\)`, and only that group.

Result is a vector length `\(n\)` with values in `\(\{1 \ldots K \}\)` giving cluster assignments for each observation.

---
We implement this with the following algorithm (details in ISLR ch 10)

1. **Fix `\(K \ge 1\)`** number of clusters
2. **Initialize:** Randomly assign a group `\(k\)`, from `\(k = 1 \ldots K\)`, to each observation.
3. **Repeat until cluster assignments do not change**:

3a. For each cluster `\(C_k\)` compute the cluster centroid, i.e. the 'average position' in `\(p\)`-dimensional space. Notice this also is a `\(p\)`-dimensional vector `$$\bar{X}_k =  \frac{1}{|C_k|}\sum_{i\in C_k} X_{i}$$`

3b. Assign observation `\(i\)` to the cluster `\(k\)` minimizing the distance between `\(X_i\)` and `\(\bar{X}_k\)`, in other words
`$$\text{argmin}_{k = 1 \ldots K} \sum_{j = 1}^p(X_{ij} - \bar{X}_{kj})^2$$`

---
# K means in `R`

There's a function for that: `kmeans`

### Syntax
```
kmeans(data_matrix, K)
```

### `matrix` class not data frame
`data_matrix` in the syntax above must be a numeric matrix object.

That is not the same type of object as a data frame in `R`, though they look the same to the human eye. Remember: Can check the object class with `class` function.

A numeric matrix is a matrix with only `numeric` type vectors.

Convert a data frame `df` to a matrix with `data.matrix(df)` or `as.matrix`.

# A smaller BISON

### What patterns can we find in the location and time data?
I created a smaller version of the old `bison` dataset for Orange County. Remember, these are human-recorded observations of species in the county from 1700 to 2015.

- remove observations with missing `eventDate`. These were the observation dates.
- `dtime`: a new variable giving the number of days between `eventDate` and Feb. 22, 2020
- kept only `latitude`, `longitude` and `dtime`

This dataset is on [GitHub](https://raw.githubusercontent.com/brendanrbrown/brendanrbrown.github.io/master/smallbison.csv).

---
# Why even do this?

#### Could view this as a supervised learning problem
e.g. attempting to model class labels representing different species

#### But I am curious
Is there other structure to the data? We don't know much about who collected these data or how. Perhaps we could learn something new here.

#### Will do the easiest thing first
Let's just jam our data into the `kmeans` function.

---
# BISON K means
#### This is easy! 

#### I picked four clusters arbitrarily, for now

```r
library(tidyverse)
bison &lt;- read_csv('https://raw.githubusercontent.com/brendanrbrown/brendanrbrown.github.io/master/smallbison.csv')

K &lt;- 4

set.seed(1305)
m &lt;- kmeans(data.matrix(bison), centers = K)

bison &lt;- mutate(bison, cluster = factor(m$cluster))
```

---
# Summaries


```r
group_by(bison, cluster) %&gt;% 
  summarise(n = n(), latitude = mean(latitude),
            longitude = mean(longitude),
            dtime = mean(dtime))
```

# Words of warning for k means

### Scale of data matters
Look back at the formulas. We are using a squared distance here. As a result

- big differences have proportionately more weight than small ones, e.g. `\(3^2 / 2^2 &gt; 3/2\)` 
- **variables on a larger scale than others will have more influence** on the cluster choices
- sensitive to variable scaling and transformations generally

#### A common solution
Use the `scale` function. `scale(x)` returns the vector (or matrix) `x` after subtracting the sample mean and dividing by the sample standard deviation.

**Note:** `scale` always returns a matrix. If `x` is a vector, to get back a vector do this annoying thing: `scale(x)[,1]`

### K means always returns K clusters

We will find four groups even if the observations are all basically the same.

---

### Choosing a meaningful K can be difficult

- topic for future class periods
- a neat demo: https://shiny.rstudio.com/gallery/kmeans-example.html

### Approach with a spirit of exploration

Lack of a 'correct' K gives some freedom: Use K means to augment your data exploration techniques to find interesting patterns. This is not a prediction problem!
